import React from "react";
import { useHistory } from "react-router-dom";

export default function StockTransferSubTabs() {
    const history = useHistory();
    const handleProductionReceive = () => {
        history.push("/inventory/stock/stock-transfer/production-receive")
    }
    const handleStockReceive = () => {
        history.push("/inventory/stock/stock-transfer/stock-receive")
    }
    const handleStockSend = () => {
        //history.push("/inventory/stock/sales-return/received-qa-list")
    }

    return (
        <>
            {/* TODAY SALE ROW */}
            <div>  
                <div className="mt-5 collection-budget-tabs">
                    <ul class="nav nav-pills mb-3" id="pills-tab" role="tablist">
                        <li class="nav-item" role="presentation">
                            <a class="nav-link" id="pills-inventory-stock-stock-transfer-production-receive-tab" data-toggle="pill" href="#pills-inventory-stock-stock-transfer-production-receive" role="tab" aria-controls="pills-inventory-stock-stock-transfer-production-receive" aria-selected="false" onClick={handleProductionReceive}>Production Receive</a>
                        </li>

                        <li class="nav-item" role="presentation">
                            <a class="nav-link" id="pills-inventory-stock-stock-transfer-stock-receive-tab" data-toggle="pill" href="#pills-inventory-stock-stock-transfer-stock-receive" role="tab" aria-controls="pills-inventory-stock-stock-transfer-stock-receive" aria-selected="false" onClick={handleStockReceive}>Stock Receive</a>
                        </li>

                        <li class="nav-item" role="presentation">
                            <a class="nav-link" id="pills-inventory-stock-stock-transfer-stock-send-tab" data-toggle="pill" href="#pills-inventory-stock-stock-transfer-stock-send" role="tab" aria-controls="pills-inventory-stock-stock-transfer-stock-send" aria-selected="false" onClick={handleStockSend}>Stock Send</a>
                        </li>
                    </ul>
                </div>
            </div>
        </>
    );
}
